using System.Collections.Generic;
using Bridge.Html5;
using Philadelphia.Common;
using Philadelphia.Web;

namespace Philadelphia.Demo.Client {
    public class FlexibleLayoutContentFormView : IFormView<HTMLElement> {
        private static readonly IDictionary<LayoutModeType,string> _icons = new Dictionary<LayoutModeType, string> {
            {LayoutModeType.ActionsTitleExtra_Body,  "data:image/svg+xml;base64,"},
            {LayoutModeType.ExtraActionsTitle_Body,  "data:image/svg+xml;base64,"},
            {LayoutModeType.ExtraTitle_Body_Actions, "data:image/svg+xml;base64,"},
            {LayoutModeType.Title_Body_ActionsExtra, "data:image/svg+xml;base64,"},
            {LayoutModeType.TitleExtra_Actions_Body, "data:image/svg+xml;base64,"},
            {LayoutModeType.TitleExtra_Body_Actions, "data:image/svg+xml;base64,"} };

        public IView<HTMLElement>[] Actions => new IView<HTMLElement>[0];
        public LabellessReadOnlyView CurrentModeName {get; } = new LabellessReadOnlyView("div", TextType.TreatAsHtml);
        public RadioBasedSingleChoice LeftPanelLayout { get; } 
            = RadioBasedSingleChoiceUtilExtensions.BuildForEnum(
                LayoutModeType.TitleExtra_Actions_Body, 
                x => x.ToString(), 
                x=>(LayoutModeType)x,
                (ctn,itemsCount) => {
                    ctn.Style.Display = Display.Grid;
                    ctn.Style.SetProperty("grid-template-columns", "0fr 0fr auto");
                    ctn.Style.SetProperty("align-items", "center");
                    return Unit.Instance; },
                (ctx, ctn, internalValue, itemElem, lblElem, itemNo) => {
                    ctn.AppendChild(itemElem);
                    ctn.AppendChild(lblElem);
                    ctn.AppendChild(new HTMLImageElement {Src = _icons[internalValue]});
                } );

        public RenderElem<HTMLElement>[] Render(HTMLElement parent) {
            parent.Style.Height = "calc(100vh - 90px)";
            return new RenderElem<HTMLElement>[] {
                CurrentModeName,"<br><br><br><div>Select layout below and see effect in the left panel</div>",LeftPanelLayout
            };
        }
    }
}
